import React from "react";
import "./Header.css";
import { Link } from "react-router-dom";
import Navbar from "./Navbar";

function Header() {

  return (
    <div className="header">

      <Navbar />
      <h1>DashBoard</h1>

      <div className="header__search">
      <Link to="/">
        <img
          className="header__logo"
          src="logo.png"
          alt=""
        />
      </Link>
      </div>
    </div>
  );
}

export default Header;
